o=(e,t)=>{const n=e.__vccOpts||e;for(const[r,s]of t)n[r]=s;return n},Ta={},La={class:"about__container"},Da=se("p",null,[ne(" - Teil der Projektarbeit zum Europaprojekt von Sepand Sanei, Mustafa Cetin und Rufus Sommer"),se("br")],-1),$a=se("p",null," - Letzterer hat diese Website erstellt ",-1),Fa=se("i",null,"Europa in einem Zeitstrahl",-1),ja=se("p",null," - Verworfen weil es nicht genügend Spielraum für AFB3 (eigene Meinung und Weiterdenken) gab ",-1);function Na(e,t){const n=rn("router-link");return Re(),Ze("div",La,[Da,$a,se("p",null,[ne(" - Ursprünglicher Plan: "),Fa,ne(" ("),U(n,{to:"/"},{default:_e(()=>[ne("siehe Modell")]),_:1}),ne(" (wird auf kleinen Bildschirmen gar nicht oder fehlerhaft angezeigt)) ")]),ja])}const za=go(Ta,[["render",Na]]),Ha={},Ba={class:"final"},Va=tc('<div class="final__container"><h1>Entwicklung von Rechtsextremismus</h1><p> Die Geschichte von Rechts­extremismus reicht weit zurück.<br> Zum Beispiel gab es schon im Mittelalter Judenhass. Christen war es nämlich zu der Zeit verboten, Bankgeschäfte zu machen und so übernahmen es oft Juden und es entstanden Vorurteile, dass Juden <i title="(Dieses Vorurteil wird auch im Drama &quot;Andorra&quot; von Max Frisch aufgegriffen)">geldfokussiert</i> waren. Außerdem mussten sie beispiels­weise auch als Sündenbock für die Pest hinhalten und wurden verfolgt.<br> Wir fangen hier aber mit der Nachkriegszeit vom 2. Weltkrieg an. Zu der Zeit gab es Armut und Unsicherheit.<br> Allgemein profitieren rechte Parteien oft von Unsicherheit und Unzufriedenheit, weil die Menschen dann Veränderung wollen. Und das ist genau das, was rechte Parteien anbieten: eine Alternative. Die AfD trägt das Wort schon im Namen.<br> So wuchsen die Wahlerfolge von recht(sextrem)en Parteien zeitweise auf bis zu 11 % in manchen Bundes­ländern.<br> Bald jedoch passierte das Wirtschafts­wunder von 1950 und brachte mehr Stabilität, die das Bedürfnis nach einer &#39;Alternative&#39; verringerte.<br> In den 60-ern fand eine Wirtschafts­krise statt, die den Aufstieg der NPD (National­demokratische Partei Deutschland) begünstigte. Diese verlor aber deswegen wieder an Relevanz, weil andere Einflüsse dazwischen spielten: Auf eine alleinige CDU (/CSU)-Koalition ab 1966 folgte eine SPD-FDP-Koalition in 1969. Die CDU (/CSU) brauchte mehr Wähler. Letzten Endes gelang es ihr, der NPD vier Fünftel ihrer Wählerschaft abzuschöpfen. Die NPD konnte das mur schwer wegstecken.<br> Mehrere Faktoren in Westeuropa wie sozialer Wandel oder aber auch Migration lösten in den 80er Jahren eine weitere Welle an Rechts­extremismus aus. So gewann auch wieder die NPD an Stimmen und nahm 1989 mit über 7 % die Fünf-Prozent-Hürde in der Europawahl.<br> Nach dem Mauerfall in 1989 gehörte schließlich auch Ostdeutschland wieder dazu und Menschen, die bereits in der DDR bei Protesten auf Polizeigewalt gestoßen waren, hatten eine höhere Gewaltbereit­schaft. So fand etwa dei Hälfte rassistischer Gewalttaten zwischen 1991 und 1994 in Ostdeutschland statt.<br> Dennoch hatten die rechten Parteien im Osten wenig Erfolg. Den hatten sie erst 1998 durch die Unzufriedenheit in Folge des System­wechsels und brachten es auf teilweise über 10 %. Anfang der 2000ern stieg die rechts­extremen Straf- und Gewalttaten.<br> Die AfD wurde 2013 als europa­skeptische, wirtschafts­liberale und national­liberale Partei gegründet.<br><br> Autor: Rufus Sommer<br> (Quellen: Q1)<br></p><h1>Rechtsextremismus in der Europawahl</h1><p> In den letzten Jahren ist Europa nach rechts gerückt. Zumindest kann man das aus der Europawahl 2014 schließen.<br> Rechts­populistische Parteien haben sich in den verschiedensten Ländern etabliert, eine dauerhafte Erscheinung in dem Regierungs­sitz und auch ihre Augen auf die Europawahl geworfen.<br> Zurzeit gibt es 2 große Fraktionen, die dem rechten Spektrum zuzuordnen sind:<br> Die EKR-Fraktion (Europäische Konservative und Reformen) und die ID-Fraktion (Identität und Demokratie).<br> Die EKR-Fraktion stellen 66 Abgeordnete aus 20 verschiedenen Parteien aus 16 Mitglieds­staaten. Das Zentrum der Fraktion besteht aus den 24 Abgeordneten aus der PiS (Recht und Gerechtigkeit), die in Polen im Regierungs­sitz sind.<br> Die ID-Fraktion hat 62 Abgeordnete aus 8 Mitglieds­staaten und mit 25 Abgeordneten aus der Italienischen Lega führen Sie die Fraktion.<br> Die AfD gehört auch zu der ID-Fraktion.<br> Damit sind 139 der 705 Europa­abgeordneten, dem Lager der Rechts­populisten und Rechtsextremen zugehörig.<br><br> Warum gibt es 2 rechte Fraktionen im Europaparlament?<br><br> Es gibt verschiedene Gründe warum 2 rechte Parteien im Europa­parlament existieren. Zum Beispiel haben sich die Parteien der ID-Fraktion, mehrere Male dafür ausgesprochen aus der EU auszutreten.<br> Auch sind die beiden Fraktionen sich nicht einig über die Positionen, die sie zu Russland vertreten wollen. Sie streiten sich auch über die Migrations­politik, da die Parteien aus den südlichen EU-Staaten wollen, dass die anderen EU-Mitglieder die Flüchtlinge aus dem Mittelmeer aufnehmen, um Druck von ihnen zu entlasten, da sie viele Probleme mit der schieren Menge der Flüchtlinge aus dem Mittelmeer haben.<br><br> Autor: Mustafa Cetin<br> (Quellen: Q2)<br></p><h1>Die AfD - Der Rechtsextreme Verdachtsfall</h1><p> Die AfD erhält immer mehr Stimmen in den Wahlen. Das liegt daran, dass der Rechts­radikalismus zunimmt, weil viele Menschen denken, dass die AfD die richtige Lösung für die heutige Gesell­schaft ist. Doch was sind die Ziele der AfD und wie könnte eine Zukunft mit der AfD in der Regierung aussehen und warum sollte man sie nicht wählen?<br><br> Die AfD hat vor, im großen Maß abzuschieben. Darunter fällt alles, außer die Deutsche Herkunft, worunter man nicht die Deutsche Staats­angehörig­keit versteht, sondern die sogenannte &quot;Bio-Deutsche&quot; Nationalität, also jeder der seit 3 Generationen 100 % deutsch sind. Dadurch würden die meisten Menschen mit einem Migrations­hintergrund nicht mehr in der Lage sein, in Deutschland zu Leben, worunter sehr viele Menschen auch aus dem GSG fallen würden.<br><br> Das nächste Ziel der AfD ist es, aus der Europäischen Union (EU) auszusteigen.<br> Dies wäre ein Wirtschaft­licher Nachteil und würde ein gemeinsames Europa schwächen. Es könnte dafür sorgen, dass die Europäischen Länder feindseliger miteinander kommunizieren und verhandeln. Das ein- und ausreisen von Deutschland in andere europäische Länder würde viel schwieriger und umständ­licher werden. Außerdem plant die AfD den Euro in Deutschland abzuschaffen und den D-Mark wieder einzuführen, was auch dazu beitragen würde, die deutsche Wirtschaft zunächst auf den Kopf zu stellen.<br> Zusammengefasst würden sich Deutschland und Europa auseinanderleben und unseren Kontakt zu vielen europäischen Ländern stark schwächen.<br><br> Die AfD zu wählen würde Deutschland in eine wirtschaft­liche Krise mit schlimmen Folgen bringen. Ein großer Teil der Sozial­arbeit wird von Menschen mit Migrations­hintergründen (MH) ausgeführt. Es würde dazu führen, dass in jeder Branche die Arbeiter mangeln. Außerdem plant die AfD die Beziehung zu östlichen Ländern, wie Russland etc. zu stärken, was bedeuten würde, dass die Beziehung zu westlichen Staaten automatisch schwächer werden würde. Auf den Klimawandel und eine bessere Umwelt setzt die AfD keinen Wert. Ganz im Gegenteil würde die AfD die Kosten, welche der Staat bislang in Erneuerbare Energien investiert hat, in großen Maßen senken. Insgesamt ist es meines Erachtens nach sehr sinnlos die AfD zu wählen, weil sie Deutschland in jeder Hinsicht verschlechtern und schwächen würde.<br><br> Autor: Sepand Sanei<br> (Quellen: Q3)<br></p><h1>Quellen</h1><div class="final__quote"><h3>Q1: </h3><p><a href="https://www.bpb.de/themen/rechtsextremismus/dossier-rechtsextremismus/41907/geschichte-des-rechtsextremismus-von-1945-bis-2005/">www.bpb.de</a><br><a href="https://www.historisches-lexikon-bayerns.de/Lexikon/Judenverfolgungen_(Spätmittelalter)">www.historisches-lexikon-bayerns.de</a><br><a href="https://www.mdr.de/geschichte/weitere-epochen/mittelalter/juden-im-mittelalter-100.html">www.mdr.de</a><br><a href="https://de.wikipedia.org/wiki/Alternative_für_Deutschland">de.wikipedia.org</a><br></p></div><div class="final__quote"><h3>Q2: </h3><p><a href="https://www.deutschlandfunk.de/afd-rechtsextremisten-rechtspopulisten-europa-parlament-wahl-102.html ">www.deutschlandfunk.de</a></p></div><div class="final__quote"><h3>Q3: </h3><p><a href="https://www.tagesschau.de/thema/afd">www.tagesschau.de</a></p></div></div>',1),Ua=[Va];function Wa(e,t){return Re(),Ze("div",Ba,Ua)}const Ka=go(Ha,[["render",Wa]]),Ga=[{path:"/",component:Ca},{path:"/about",component:za},{path:"/link2",component:Ia},{path:"/link3",component:{}},{path:"/page",component:Ka}],qa=Hu({history:mu(),routes:Ga}),Kr=$c(pa);Kr.use(Uu());Kr.use(qa);Kr.mount("#app");
